CREATE TABLE `cms_event_alert` (
  `event_id` int(10) NOT NULL COMMENT '告警事件编号',
  `channel_id` varchar(32) DEFAULT NULL COMMENT '告警事件发生对应的通道编号',
  `channel_name` varchar(32) DEFAULT NULL COMMENT '告警事件发生对应的通道名称用于前端页面展示',
  `event_start_time` datetime NOT NULL COMMENT '告警事件发生的时间',
  `type_description` varchar(50) NOT NULL COMMENT '告警事件的推送类型',
  `type_status` varchar(20) DEFAULT '正确告警' COMMENT '事件告警的正确情况（正确告警、错误识别）',
  `type_rectify` varchar(50) DEFAULT '无' COMMENT '错误告警的纠正类型',
