  `channel_latitude` varchar(50) NOT NULL COMMENT '告警事件所属的通道的维度',
  `channel_org` varchar(50) NOT NULL COMMENT '告警事件所属通道的所属组织',
  `channel_grid_id` int(10) NOT NULL COMMENT '告警事件所属通道所在的网格编号',
  `event_data` mediumblob COMMENT '告警事件的图片或者视频资源',
  `event_check` varchar(50) DEFAULT '未复核' COMMENT '告警事件的复核状态（未复核，正常，信息误报，错误识别，）',
