  `event_end_time` datetime DEFAULT NULL COMMENT '告警事件的处理时间',
  `event_reviewer` varchar(50) DEFAULT NULL COMMENT '告警事件的复核人,',
  PRIMARY KEY (`event_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
